import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

import axios from 'axios';
import deleteVehicle from './DeleteVehicle';

export default function AllVehicle() {
  const [vehicle, setVehicles] = useState([]);

  const getVehicle = () => {
    axios.get('http://localhost:6060/Vehicle/')
      .then((res) => {
        console.log(res.data);
        setVehicles(res.data);
      })
      .catch((err) => {
        alert(err.message);
      });    
      
  };

  

  useEffect(() => {
    getVehicle();
    
  }, []);

  const handleDelete = (vehicleId) => {
    deleteVehicle(vehicleId)
      .then(() => {
        alert('Vehicle deleted successfully');
        getVehicle();
      })
      .catch((err) => {
        alert('Vehicle not deleted: ' + err);
      });
  };

  

  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: 'auto', backgroundColor: '#808080' }}>
      <h1 style={{ marginLeft: '-200px' }}>All Vehicles</h1>
      <div style={{ height: '400px', overflowY: 'auto', marginTop: '50px', marginLeft: '130px' }}>
        <table style={{ borderCollapse: 'collapse', width: 'auto', margin: 'auto', border: '1px solid #000' }}>
          <thead style={{ position: 'sticky', top: '0', zIndex: '1', backgroundColor: '#fff' }}>
            <tr style={{ borderBottom: '1px solid #000' }}>
              <th style={{ border: '1px solid #000' }}>regnumber</th>
              <th style={{ border: '1px solid #000' }}>Brand</th>
              <th style={{ border: '1px solid #000' }}>Model</th>
              <th style={{ border: '1px solid #000' }}>available</th>
              <th style={{ border: '1px solid #000' }}>Price Per Day</th>
              <th colSpan={3} style={{ border: '1px solid #000' }}>Action</th>
            </tr>
          </thead>
          <tbody>
            {vehicle.map((v, index) => (
              <tr key={index} style={{ color: '#000000', borderBottom: '1px solid #000' }}>
                <td style={{ border: '1px solid #000' }}>{v.regnumber}</td>
                <td style={{ border: '1px solid #000' }}>{v.brand}</td>
                <td style={{ border: '1px solid #000' }}>{v.model}</td>
                <td style={{ border: '1px solid #000' }}>{v.available}</td>
                <td style={{ border: '1px solid #000' }}>Rs: {v.priceperday}</td>
                <td style={{ border: '1px solid #000' }}>
                  <img
                    src={`http://localhost:6060/images/eye.png`}
                    alt={`${index}`}
                    style={{ width: '40px', height: '40px', objectFit: 'cover', cursor: 'pointer', marginRight: '10px' }}
                    onClick={() => handleDelete(v._id)}
                  />
                </td>
                <td style={{ border: '1px solid #000' }}>
                  <img
                    src={`http://localhost:6060/images/delete.png`}
                    alt={`${index}`}
                    style={{ width: '30px', height: '30px', objectFit: 'cover', cursor: 'pointer' }}
                    onClick={() => handleDelete(v._id)}
                  />
                </td>
                <td style={{ border: '1px solid #000' }}>
                  <a className="nav-link" href={`/update/${v._id}`}>
                    <img
                      src={`http://localhost:6060/images/edit.png`}
                      alt={`${index}`}
                      style={{ width: '30px', height: '30px', objectFit: 'cover', cursor: 'pointer', marginRight: '10px' }}
                    />
                  </a>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>

  );
}
